import '../App.scss';

const ThanksBlock = ({ refer, closeWindow }) => {
  return (
    <div className="p-10 md-p-l5">
      <div className="thanks1-popup bg-black br-8 p-5 md-p-m5 flex flex-wrap md-justify-between md-items-center show">
        <div className="box br-8 bg-black w-70pc md-w-70pc">
          <div ref={nodeRef} className="center br-8 w-60pc md-w-60pc">
            <div className="white br-8" onClick={() => setShowThanksMessage(false)}>
              <p className="closec">&times;</p>
            </div>
            <h1 className="white fs-m4 fw-800 br-8 text-center">
              Спасибо за запрос! Твоя заявка принята!
            </h1>
            <p className="fw-600 indigo-lightest opacity-40 br-8 text-center">
              Совсем скоро мы свяжемся с тобой, чтобы обсудить все вопросы!
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ThanksBlock;
